import 'dart:convert';

import 'address.dart';
import 'name.dart';

class Users {
  Address? address;
  int? id;
  String? email;
  String? username;
  String? password;
  Name? name;
  String? phone;
  int? v;

  Users({
    this.address,
    this.id,
    this.email,
    this.username,
    this.password,
    this.name,
    this.phone,
    this.v,
  });

  @override
  String toString() {
    return 'Users(address: $address, id: $id, email: $email, username: $username, password: $password, name: $name, phone: $phone, v: $v)';
  }

  factory Users.(
      Map<String, dynamic> data) {
    return Users(
      address: data['address'] == null
          ? null
          : Address
              .(
                  data['address'] as Map<String, dynamic>),
      id: data['id'] as int?,
      email: data['email'] as String?,
      username: data['username'] as String?,
      password: data['password'] as String?,
      name: data['name'] == null
          ? null
          : Name
              .(
                  data['name'] as Map<String, dynamic>),
      phone: data['phone'] as String?,
      v: data['__v'] as int?,
    );
  }

  Map<String, dynamic>
      () {
    return {
      'address': address
          ?.(),
      'id': id,
      'email': email,
      'username': username,
      'password': password,
      'name': name
          ?.(),
      'phone': phone,
      '__v': v,
    };
  }

  /// `dart:convert`
  ///
  /// Parses the string and returns the resulting Json object as [Users].
  factory Users.fromJson(String data) {
    return Users
        .(
            json.decode(data) as Map<String, dynamic>);
  }

  /// `dart:convert`
  ///
  /// Converts [Users] to a JSON string.
  String toJson() => json.encode(
      ());

  Users copyWith({
    Address? address,
    int? id,
    String? email,
    String? username,
    String? password,
    Name? name,
    String? phone,
    int? v,
  }) {
    return Users(
      address: address ?? this.address,
      id: id ?? this.id,
      email: email ?? this.email,
      username: username ?? this.username,
      password: password ?? this.password,
      name: name ?? this.name,
      phone: phone ?? this.phone,
      v: v ?? this.v,
    );
  }
}
